	function addDataToMap1(data, map) {
		var dataLayer = L.geoJson(data, {
			onEachFeature: function(feature, layer) {            var popupText = "<table><tr><th>BLUE: </th><td>" + feature.properties['BLUE']+"</td></tr>";             var popupText = popupText+ "<tr><th>COUNT: </th><td>" + feature.properties['COUNT']+"</td></tr>";             var popupText = popupText+ "<tr><th>bounds: </th><td>" + feature.properties['bounds']+"</td></tr>";             var popupText = popupText+ "<tr><th>COLORKEY: </th><td>" + feature.properties['COLORKEY']+"</td></tr>";             var popupText = popupText+ "<tr><th>GREEN: </th><td>" + feature.properties['GREEN']+"</td></tr>";             var popupText = popupText+ "<tr><th>X: </th><td>" + feature.properties['X']+"</td></tr>";             var popupText = popupText+ "<tr><th>Y: </th><td>" + feature.properties['Y']+"</td></tr>";             var popupText = popupText+ "<tr><th>GEOHASH: </th><td>" + feature.properties['GEOHASH']+"</td></tr>";             var popupText = popupText+ "<tr><th>RED: </th><td>" + feature.properties['RED']+"</td></tr>"; 
	    		layer.setStyle({color: feature.properties['COLORKEY'], weight: 6, opacity: 1});

					}
				);
		            layer.bindPopup(popupText, {autoPan:false, maxHeight:500, maxWidth:350} ); }
	        });
	    
		map.on('dragend',function(e) {
			var skillsSelect = document.getElementById("GEOHASH");
			var selectedText3 = skillsSelect.options[skillsSelect.selectedIndex].text;

			var outerbounds = [[map.getBounds()._southWest.lng,map.getBounds()._northEast.lat],[map.getBounds()._northEast.lng,map.getBounds()._southWest.lat]]
